<script id="vertex-shader" type="x-shader/x-vertex">

attribute  vec3 vPosition;
attribute  vec4 vColor;
attribute  vec3 vNormal;
varying vec4 fColor;

uniform mat4 p;
uniform mat4 v;
uniform mat4 m;


uniform float floor ;
vec3 lightPos = vec3(10, 10 , 10);



void main() 
{		
	vec4 tColor = vec4(0.50,1.0,0.55, 1.0 );	
	
	vec4 temp = p * v * m * vec4(vPosition , 1.0 );
	
	vec3 lightDir = normalize(lightPos - vec3(v * m *  vec4(vPosition , 1.0 )));
	vec3 wNormal = normalize ( mat3(v * m ) * vNormal);
	float kd = max(dot(wNormal , lightDir) , 0.0);
	
	fColor = vec4( vec3(tColor * kd) , 1);
		
	
	
	if(vPosition[1] < -0.269425 ){

	if(floor == 2.0)
	fColor = vec4(1.0,1.0,  1.0,  1.0);
	else
	fColor =vec4( 1.0 , 1.0,  1.0,  1.0);;
	}
	
    gl_Position = temp;
} 
</script>
